import React from "react"

function redirectToImage(props) {
    console.log(props);
}

function Card(props) {
return (
<div className="card">
    <button onClick={redirectToImage(props.imgSrc)}>
        <img src={props.imgSrc}></img>
    </button>
</div>
);
}

export default Card
